import React, { Component } from "react";
import {
    Container, Row, Col
} from 'react-bootstrap';

class About extends Component {
    render() {
        return (
            <div className="component_content about">
                <Container>
                    <Row>
                        <Col>
                            about
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default About;
